ьготную очередь на предоставление земельного участка для индивидуального жилищного строительства бесплатно в собственность, согласно Постановления администрации Фрунзенского сельского поселения Сакского района Республики Крым № 187 от 29.09.2022 г. \r\nЕму сообщили, что в настоящее время ведутся работы по формированию земельных участков для обеспечения льготной категории граждан земельными участками в соответствии с Законом Республики Крым № 187 от 29.09.2022 г. \r\nПосле формирования земельных участков и регистрации муниципальной собственности, администрация уведомит о возможности предоставления земельного участка.\r\nЭтот земельный участок он должен получить как ветеран боевых действий на основании ст. 16 ФЗ \"О ветеранах\".\r\nЕще принято Постановление Совета Министров Республики Крым от 29.12.2022 № 1288 \"Об утверждении порядка учета отдельных категорий граждан и предоставлении им земельных участков на территории Республики Крым\".\r\nВопрос: можно ли по этому Постановлению получить землю и не вылететь из очереди по первому основанию?\r\nПо Постановлению формируют фонд, изначально предполагается, что в Саках и Черноморском районе, но говорят, что по всей территории Республики Крым можно. Понять, что за фонд и можно ли во Фрунзенском поселении получить тоже по этому Постановлению.','2023-01-13 14:02:57','задача',0),(501,'Клименко Артем Владимирович','ИП Климкенко Перепроверить договор тех заказчика','2','2023-01-11 19:00:00','выполнена',3.50,'2023-01-10 09:46:50','2023-02-06 12:24:56',20,'https://disk.yandex.ru/client/disk/%D0%94%D0%95%D0%9B%D0%90/%D0%98%D0%9F%20%D0%9A%D0%BB%D0%B8%D0%BC%D0%B5%D0%BD%D0%BA%D0%BE%20%D0%90.%D0%92./%D0%9F%D1%80%D0%BE%D0%B5%D0%BA%D1%82%20%D0%94%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80%20%D0%A2%D0%B5%D1%85.%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D1%87%D0%B8%D0%BA','приоритет',3,3,'ИП Клименко',NULL,'задача',0),(502,'Рябов Роман Павлович','Эколес - 2 иска в АС','65','2023-01-12 16:00:00','выполнена',3.00,'2023-01-10 09:49:50','2023-03-15 15:57:17',19