).\r\nhttps://disk.yandex.ru/d/JC54Omc-mGmP-Q\r\nНа диске pdf. В нем апелляционная жалоба и текст решения. На самом главном о согласии Шифрина везде есть закладки в документе. Задача: в возражениях обосновать, что решение суда правильное и отмене не подлежит. Образцы возражений на диске.\r\nАргументы в нашу пользу:\r\n1) Шифрин дал согласие в нотариальной форме Шифриной на совершение любых сделок с земельными участками (судом установлено, материалами дела подтверждается, выписать из решения суда реквизиты соглашения);\r\n2) Стороны свободны в заключении сделок;\r\n3) внимательно почитать, что там они в апелляционной жалобе по фактажу пишут про КФХ при Украине. Спросить у меня, когда не будет правопреемства по КФХ.','2023-01-23 12:17:26','задача',0),(654,'Макарушин Сергей Владимирович','Макарушин - придумать способ защиты','4','2023-01-25 14:00:00','выполнена',2.00,'2023-01-22 18:45:23','2023-01-25 16:02:47',212,'','срочно',2,4,'Что можно сделать на этапе приостановки и что можно сделать с отказным письмом? Сначала обжаловать бездействие, а потом обжаловать отказ? (Что у Гусейнова в аналогичной ситуации выбрали',NULL,'задача',0),(655,'Панина Жанна Владимировна пенсия','Панина - записать к нотариусу Андреевой','66','2023-01-23 09:00:00','выполнена',1.00,'2023-01-22 18:53:48','2023-01-23 09:17:39',44,'','срочно',4,4,'Номер телефона: +7 978 752-95-72\r\nЗовут: Кристина Владимировна \r\nПредставиться помощником адвоката Мины Марка Анатольевича. Попросить сегодня примерно часиков в 12 записать нас сделать доверенность судебную. Очень хорошо ее попросить, если что, мы готовы и подождать и в 12:15, и в 12:30. (К нам доверитель придет к 12, мы сразу к ней подойдем).\r\nЕсли Андреева не может - спросить у Андрея и Жени, к кому они записывают к другому нотариусу и записать на 12 часов в понедельник.','2023-01-23 12:17:39','задача',0),(656,'Янчук Екатерина','Янчук (М) - проект возражений на апелляционную жалобу','66','2023-01-24 09:00:00','выполнена',2.00,'2023-01-22 19:05:51',