-06 19:30:55','2023-02-13 10:56:17',249,'','приоритет',4,4,'2) назначают ли досрочную пенсию только по трудовой книжке, можно ли обойтись без справок от работодателя;\r\n\r\nВ соответствии с пунктом 6 Перечня документов, необходимых для установления страховой пенсии, установления и перерасчета размера фиксированной выплаты к страховой пенсии с учетом повышения фиксированной выплаты к страховой пенсии, назначения накопительной пенсии, установления пенсии по государственному пенсионному обеспечению, утвержденного приказом Минтруда Российской Федерации от 28 ноября 2014 года N 958н, досрочные страховые пенсии назначаются на основании записей трудовой книжки и документа, подтверждающего стаж на соответствующих видах работ (справки, уточняющей характер льготной работы, и подтверждающий занятость полный рабочий день на работах с тяжелыми условиями труда) - Определение СК по гражданским делам Седьмого кассационного суда общей юрисдикции от 21 января 2021 г. по делу N 8Г-19383/2020[88-635/2021-(88-19694/2020)]\r\n\r\nСсылки заявителя жалобы на возможность включения вышеуказанных периодов работы в специальный стаж, дающий право на назначение досрочной страховой пенсии по старости, на основании записей в трудовой книжке и показаний свидетелей, несостоятельны. Имеющиеся записи в трудовой книжке истца не позволяют сделать вывод о том, что в эти периоды истец был занят на работе в должностях, предусмотренных Списком. Свидетельские показания с учетом вышеприведенных разъяснений Пленума Верховного Суда Российской Федерации являются недопустимыми доказательствами и не могут подтверждать указанные обстоятельства. - Апелляционное определение СК по гражданским делам Костромского областного суда от 08 июля 2020 г. по делу N 33-1303/2020',NULL,'задача',0),(898,'Геворкян Елена Владимировна','Геворкян - подзадача № 3','4','2023-02-13 20:00:00','выполнена',0.50,'2023-02-06 19:31:48','2023-02-13 19:30:01',249,'','срочно',2,4,'3) см. иск по Бахареву, с какого по какой период не надо подтверж