 декабре 2022, нужно ли оценивать данные за 2022 год или нужно оценивать по отчетности за 2021. У общества есть отчеты только за 2021.\r\n\r\nДля сведения:\r\nДействительная стоимость доли при выходе участника определяется только на основании статьи 23 закона «Об ООО» – по данным бухгалтерской отчётности за период, предшествующий выходу участника.\r\n\r\nПри этом выходящему участнику надо понимать, какая отчётность будет взята за основу оценки стоимости его доли. Дело в том, что по закону ООО обязано сдавать только годовую бухгалтерскую отчётность. Промежуточная отчётность – за месяц или квартал – тоже возможна, но обязанность её составления должна быть предусмотрена уставом или другим документом (например, кредитным договором). Если такой обязанности нет, то доля будет оцениваться на основании только годовой отчётности.',NULL,'задача',0),(1103,'Анна Валерьевна Милькевич','Милькевич - (ЖД) контроль даты сз: 1) по разводу; 2) по алиментам.','66','2023-03-10 14:00:00','выполнена',1.00,'2023-02-20 06:21:38','2023-03-24 14:06:53',240,'','перенос',4,4,'Иски поступили в суд 03.03\r\nпо разводу - судья Тощева\r\nпо алиментам - судья Плиева\r\n\r\nhttps://zheleznodorozhniy--krm.sudrf.ru/modules.php?name=sud_delo&srv_num=1&name_op=case&case_id=136998290&case_uid=28c850b9-bfb2-4cec-b5b0-bb00c8fd545a&delo_id=1540005\r\n\r\nhttps://zheleznodorozhniy--krm.sudrf.ru/modules.php?name=sud_delo&srv_num=1&name_op=case&case_id=137186128&case_uid=79bd78dc-6a1d-49c5-93d2-3c4325a9d272&delo_id=1540005','2023-03-18 13:40:26','задача',0),(1104,'Семенов Роман Сергеевич','заседание','42','2023-02-22 09:50:00','выполнена',1.00,'2023-02-20 07:39:32','2023-02-27 09:18:03',24,'','неважно',42,42,'Гараж\r\n Цыкуренко, КИЕВСКИЙ Р/С',NULL,'задача',1),(1105,'Семенов Роман Сергеевич','Гараж Семенов к суд.заседанию','2','2023-02-20 18:00:00','выполнена',1.00,'2023-02-20 07:41:32','2023-02-20 17:02:40',24,'','срочно',42,42,'1. Сформулировать вопросы для эксперта.',NULL,'задача',0),(1106,'ИП Богданова Елен