елить с Нами?\r\nКак привлечь мать к ответственности за неисполнение решения суда ( о порядке общения)\r\nРАСТОРГ БРАК, ЕСТЬ СОГЛАШЕНИЕ ПО АЛИМЕНТОВ, МЕСТО ЖИТЕЛЬСТВА С МАМОЙ, ПОРЯДОК ОБЩЕНИЯ С РЕБЕНКОМ (МАТЬ НЕ ДАЕТ ОБЩАТЬСЯ).\r\nВСТРЕЧКА (НОРМАЛЬНО ОБЩАТЬСЯ)\r\nСБОР ДОКАЗАТЕЛСЬТВ К ПРОЦЕССУ: КАК ОТ ПИСХОЛОГА ПОЛУЧИТЬ КАКОЙ-ТО ДОКУМЕНТ, КОТОРЫЙ ПОКАЖЕТ, ЧТО ОТЕЦ НЕ ОКАЗЫВАЕТ ПСИХОЛОГИЧЕСКОЕ ДАВЛЕНИЕ НА РЕБЕНКА И ЧТО РЕБЕНКУ ХОРОШО С ОТЦОМ, ОТНОШЕНИЕ К РОДИТЕЛЯМ (ТИП ПРИВЯЗАННОСТИ). ДОКУМЕНТ: СПРАВКА ИЛИ ЗАКЛЮЧЕНИЕ (ДОСУДЕБНОЕ).\r\n\r\nСрок до пн.-вт.',NULL,'задача',0),(1239,'Болотин Анатолий Павлович','Оценить перспективы дела до 24.03.2023','4','2023-03-20 20:00:00','просрочена',1.00,'2023-03-01 10:41:22','2023-03-21 12:21:12',235,'https://disk.yandex.ru/d/e7GrNPhaAovAYw','неважно',39,2,'Марк Анатольевич! \r\nВысылаю Вам пакет документов, которые Вы  запросили после консультации(Судак) по вопросу необоснованных платежей(необоснованного обогащения), и  пояснение.\r\n-В 2001 году 98 жителей посёлка Новый Свет стали соучредителями организованного ими кооператива «Горный»  с целью  оформления самовольно занятой ими в 90х. годах территории пл. 4.4га, на которой находились  используемые ими земельные участки ( сегодня это ПКИЗ «Горный — Новый Свет», в дальнейшем Кооператив).  Однако при Украине  оформить эту землю Кооперативу не удалось.\r\n- В 2015г.  после вхождения Крыма в состав России региональной властью был принят закон - 66ЗРК/2015 и Постановление Совета Министров № 252 от 12 мая 2015г., позволяющие физ. лицам индивидуально оформить.земельные участки с  самовольно возведённой постройкой. \r\n-В 2017г. на общем Собрании членов Кооператива председатель Кооператива- Ушицкий О.А,. избранный в 2014г.,   вынес на голосование свой пошаговый план оформления земельных участков и строений .Этим планом предусматривалось выполнение следующих Проектов: проект планировки территории(4,4 га)-ППТ, проект межевания территории-ПМТ; эскизный проект территории,  с внесением их через общественные слушания  в Проект землеустройства и застройки и Генплан Судакского муниципального образования.\r\nСогласно  плану  Ушицкого, отражённого в протоколе Собрания,  исключалась возможность индивидуального  оформления  земельного участка и строения на нём без выполненных и согласованных Проектов.\r\n За  пошаговый план и за внесённое на этом же Собрании предложение  «об исключении из проектной документации  чл. Кооператива, которые не  оплатят работы по выполнению этой  проектной документации»,  проголосовали «за»  единогласно .(Протокол от 2017г.) \r\nНеобходимо пояснить такое 100% «единодушие» членов Кооператива в принятии этих решений. Люди безоговорочно доверились Ушицкому в вопросах оформления «своих» земельных участков, так как Ушицкий имел   юридическое образование, а также будучи членом',NULL,'задача',0),(1240,'ООО Югстройкапитал','Договор субаренды','4','2023-03-03 20:00:00','выполнена',4.00,'2023-03-01 10:49:16','2023-03-27 17:15:55',292,'https://disk.yandex.ru/d/bglaFiLKmKHc9A','приоритет',2,2,'Подготовить проект договора субаренды максимально защищающий субарендодателя и согласующийся с основным договором аренды.\r\nПредусмотреть расторжение с извещением в одностороннем порядке, обязанность освободить помещение за 5 дней, штраф за неисполнение, неустойку, возможность прекращать доступ к коммуникациям, предусмотреть пожарные риски под субарендаторов. Предложить доп гарантии.\r\nПод проект этого договора сделать еще один договор для субарендатора - разливное пиво. Арендатор просит указать в одном из договоров, что распитие на территории магазина, тц и прилегающей территории запрещена - это для субаренды роливного пива.',NULL,'задача',0),(1241,'Янчук Екатерина','Янчук - заседание','4','2023-03-13 10:30:00','выполнена',2.00,'2023-03-01 13:54:25','2023-04-09 21:24:40',64,'','неважно',2,2,'Описания нет',NULL,'заседание',0),(1242,'Янчук Екатерина','Подготовка к СЗ','4','2023-03-07 20:00:00','выполнена',3.00,'2023-03-01 13:54:59','2023-04-09 21:24:42',6