 встречный иск - по изменению порядка общения с ребенком','67','2023-03-09 09:00:00','выполнена',3.00,'2023-03-08 07:03:40','2023-04-03 18:22:32',294,'https://disk.yandex.ru/d/EaytDjjL25hmHg','срочно',4,4,'Защищаем отца, которому мать не дает общаться с ребенком. Мать подала к нашему отцу иск об изменении порядка общения. Мы подаем встречный иск. Стороны: истец по встречному иску (ответчик по первоначальному иску) - отец, ответчик по встречному иску (истец по первоначальному иску) - мать.\r\n(шапку и просительную готовила Ксения, попросить ее выгрузить на диск)\r\n\r\n1) найти одно свежее хорошее решение, где родители изменяли порядок общения с ребенком (т.е. порядок общения был установлен раньше судом, потом один из родителей пошел с новым иском, чтобы изменить ранее установленный порядок общения) - чтобы мотивировать иск;\r\n2) решение суда превратить во введение, описание и мотивировку иска (пока без просительной). Обязательно указать, что ранее был установлен судом порядок общения, а мать чинит препятствия в общении с ребенком, ранее установленный судом порядок общения не соблюдает, нарушает права отца и интересы ребенка.\r\nСтруктура:\r\n- ранее был определен порядок общения, подали иск, мать чинит препятствия в общении и т.д. фактаж (см. как в решении суд описывает ситуацию)\r\n- правовое обоснование (право родителя на общение с ребенком и т.д., см. что в решении суда).',NULL,'задача',0),(1327,'Иванов Александр Михайлович','Иванов - проверка встречного иска','4','2023-03-10 09:00:00','выполнена',0.50,'2023-03-08 07:13:21','2023-04-03 18:22:33',294,'','срочно',2,4,'проверить просительную - сообразно хотелкам',NULL,'задача',0),(1328,'Иванов Александр Михайлович','Иванов - сдача результата Андрею','4','2023-03-14 14:00:00','выполнена',1.00,'2023-03-08 07:14:19','2023-04-03 18:22:34',294,'','приоритет',39,4,'Описания нет',NULL,'задача',0),(1329,'Иванов Александр Михайлович','Иванов - суд. прак - срочно','65','2023-03-13 10:00:00','выполнена',1.00,'2023-03-08 07:18