\r\nВопросы, которые надо проработать:\r\n1) Вариант 1 - уменьшить сумму;\r\n2) Собственник земельного участка мама, иск предъявлен к дочке. Проверить, чем истец доказывает, что ответчик перебила кабель\r\n(говорит, якобы воткнула штырь/уголок);\r\n3) По материалам дела проверить, есть ли у соседа-истца технические условия на подключение к электричеству. Если их не имеется, то проработать вопрос того, что сосед не мог являться собственником этого кабеля.\r\n4) Проработать вопрос законно ли вообще кабель соседа пролегает под земельным участком.',NULL,'задача',0),(1614,'Лукъянчиков Валерий Валерьевич (мать: Лариса Константиновна)','Лукьянчиков - жалоба','66','2023-03-29 10:00:00','выполнена',1.00,'2023-03-27 10:19:55','2023-03-29 23:58:12',290,'','срочно',66,66,'Описания нет',NULL,'задача',0),(1615,'ООО «Металвис-юг»','Потапов - Металвис - ДТП (Благодатная)','65','2029-03-20 09:09:00','выполнена',2.00,'2023-03-27 10:34:21','2023-04-05 17:04:05',88,'','неважно',4,4,'обжаловать по КоАПу постановление о привлечении к админ. ответственности (просим восстановить сроки)',NULL,'задача',0),(1616,'Мисюнас Вячеслав','Мисюнас - процесс по ущербу авто (ветка)','65','2023-04-15 09:00:00','просрочена',2.00,'2023-03-27 10:47:15','2023-04-10 13:09:24',163,'','неважно',4,4,'подготовиться, перепроверить ответчика, при необходимости обосновать, что ЖЭК отвечает за территорию на котором стоял автомобиль, на который упала ветка. Пока соответчика 2 - Администрация и ЖЭК',NULL,'задача',0),(1617,'ООО Югстройкапитал','Поправки в трудовой договор','4','2023-03-28 10:00:00','просрочена',1.00,'2023-03-27 11:14:34','2023-03-27 11:14:34',292,'','приоритет',3,3,'желательно пораньше на среду\r\nна почте',NULL,'задача',1),(1618,'Данич Наталья Ивановна (Данич Валерий Лукич)','Консультация - Данич Наталья Ивановна','4','2023-03-28 15:00:00','просрочена',0.50,'2023-03-27 11:58:05','2023-03-27 11:58:34',334,'','неважно',66,66,'Описания нет',NULL,'консультация',1),(1619,'Попов Владимир Федорович','Консуль