ОГОСЯН НЕ БЫЛО ДОВЕРЕННОСТИ)\r\nРАЗОБРАТЬСЯ, КАК ПРОЦЕДУРНО ПРОИСХОДИТ ПОСЛЕДУЮЩЕЕ ОДОБРЕНИЕ, СКАЗАТЬ, КАКИЕ ДОКУМЕНТЫ НАДО ПРИЛОЖИТЬ К ИСКУ В ПОДТВЕРЖДЕНИЕ ПОСЛЕДУЮЩЕГО ОДОБРЕНИЯ СДЕЛКИ.\r\nВ просительной просим взыскать сумму задатка в двойном размере в пользу Погосян и мужичка (Артем по-моему)',NULL,'задача',1),(1895,'Погосян Ася Ваниковна','Погосян - проверить иск и сдать Андрею','4','2023-04-13 12:00:00','ожидает',1.00,'2023-04-08 18:57:41','2023-04-08 18:57:41',351,'','неважно',39,4,'(до пятницы)',NULL,'задача',1),(1896,'Погосян Ася Ваниковна','Погосян - получить у Андрея подписанную претензию и отправить продавцу','66','2023-04-11 10:10:00','ожидает',1.00,'2023-04-08 18:58:31','2023-04-08 18:58:31',351,'','приоритет',4,4,'Описания нет',NULL,'задача',1),(1897,'Серебренников Артем Леонидович','Серебренников - иск о разделе автомобиля','66','2023-04-11 09:05:00','ожидает',1.00,'2023-04-08 19:02:48','2023-04-08 19:10:55',359,'','срочно',4,4,'просим признать авто совместной собственностью\r\nавто - жене, мужу компенсацию 1/2 стоимости доли\r\n(образец требований - иск по Иваницкой, обоснование можно взять, как у Милькевич или у Гончаровой, все на диске, искать по фамилии)\r\nУ Серебренникова нет документов на авто, все у жены - нам надо сделать запрос в МРЭО (как спросить у Андрея, как-то можно в электронном виде обратиться и нам предоставят ПТС и СТС). Дополнительно, как в иске по Ревило сделать ходатайство об истребовании доказательств - договора.\r\nНа основании СТС и ПТС можно без договора купли-продажи запросить оценку (Андрею сказать, что без оценки могут обездвижить иск, цена вопроса небольшая, оценщик на основании СТС и ПТС без ДКП делает оценку, у нас не будет болеть голова за обездвиж, стоимость из ДКП барть нельзя потому что ПП ВС сказал, что стоимость имущества определяется на дату раздела судом имущества супругов, скажешь ему, что так Настя сказала).\r\nИНФОРМАЦИЯ О ТРАНСПОРТНОМ СРЕДСТВЕ\r\nДата регистрации факта владения :06.10.2022 Государственный и